import React from 'react';
import styled from 'styled-components';

const Footer = () => {
  return (
    <FooterContainer>
      <FooterTop>
        <Logo>LITCLUB</Logo>
        <SocialLinks>
          <SocialIcon>
            <i className="fab fa-facebook-f"></i>
          </SocialIcon>
          <SocialIcon>
            <i className="fab fa-instagram"></i>
          </SocialIcon>
          <SocialIcon>
            <i className="fab fa-linkedin-in"></i>
          </SocialIcon>
        </SocialLinks>
      </FooterTop>
      <FooterBottom>
        <FooterLinks>
          <FooterLink>Quick Links</FooterLink>
          <FooterLink>About Us</FooterLink>
          <FooterLink>Services</FooterLink>
          <FooterLink>Contact Info</FooterLink>
        </FooterLinks>

      </FooterBottom>
      <Copyright>Â© 2025 LITCLUB. All rights reserved.</Copyright>
    </FooterContainer>
  );
};

const FooterContainer = styled.footer`
  background-color: #0a3b1e;
  color: #f8e8d8;
  padding: 2rem;
  margin-top: auto;
`;

const FooterTop = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-bottom: 1rem;
  border-bottom: 1px solid rgba(248, 232, 216, 0.2);
`;

const Logo = styled.div`
  font-size: 1.5rem;
  font-weight: bold;
  letter-spacing: 2px;
`;

const SocialLinks = styled.div`
  display: flex;
  gap: 1rem;
`;

const SocialIcon = styled.a`
  width: 30px;
  height: 30px;
  border-radius: 50%;
  background-color: rgba(248, 232, 216, 0.2);
  display: flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;

  &:hover {
    background-color: rgba(248, 232, 216, 0.3);
  }
`;

const FooterBottom = styled.div`
  display: flex;
  justify-content: space-between;
  padding: 2rem 0;
`;

const FooterLinks = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const FooterLink = styled.a`
  color: #f8e8d8;
  text-decoration: none;
  font-size: 0.9rem;
  cursor: pointer;

  &:hover {
    text-decoration: underline;
  }
`;

const ContactInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const ContactItem = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-size: 0.9rem;

  i {
    font-size: 1rem;
  }
`;

const Copyright = styled.div`
  text-align: center;
  font-size: 0.8rem;
  opacity: 0.7;
  padding-top: 1rem;
  border-top: 1px solid rgba(248, 232, 216, 0.2);
`;

export default Footer;
